import React from 'react';
import { SafeAreaView } from 'react-native';
import Navigator from '../Navigator';
import Routes from '../NewRoutes';

export default function Home() {
  return (
    <SafeAreaView style={global.backgroundColor}> 
      <Navigator/>
    </SafeAreaView>
  );
}
